import React, { useEffect, useState, useCallback } from 'react';
import { useNavigate } from 'react-router-dom';
import { jwtDecode } from 'jwt-decode';
import API from '../api';

export default function DashboardPage() {
  const [tenantInfo, setTenantInfo] = useState(null);
  const [overview, setOverview] = useState(null);
  const [eventSummary, setEventSummary] = useState(null);
  const [topCustomers, setTopCustomers] = useState([]);
  const [orders, setOrders] = useState([]);
  const [customerHistory, setCustomerHistory] = useState([]);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(true);
  const [ingesting, setIngesting] = useState(false);
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');

  const navigate = useNavigate();

  const handleLogout = useCallback(() => {
    localStorage.removeItem('token');
    navigate('/login');
  }, [navigate]);

  const fetchData = useCallback(async () => {
    try {
      setLoading(true);
      const tenantInfoRes = await API.get('/dashboard/tenant-info');
      const overviewRes = await API.get('/dashboard/overview');
      const eventSummaryRes = await API.get('/dashboard/events-summary');
      const topCustomersRes = await API.get('/dashboard/top-customers');
      const ordersRes = await API.get('/dashboard/orders');
      const customerHistoryRes = await API.get('/dashboard/customer-products');

      setTenantInfo(tenantInfoRes.data);
      setOverview(overviewRes.data);
      setEventSummary(eventSummaryRes.data);
      setTopCustomers(topCustomersRes.data.top);
      setOrders(ordersRes.data.orders);
      setCustomerHistory(customerHistoryRes.data);
      setError('');
    } catch (err) {
      setError('Failed to fetch dashboard data.');
      if (err.response?.status === 401) handleLogout();
    } finally {
      setLoading(false);
    }
  }, [handleLogout]);

  useEffect(() => {
    fetchData();
  }, [fetchData]);

  // --- MODIFIED: Added more sample data ---
  const handleIngestData = async () => {
    try {
      setIngesting(true);
      setError('');
      const token = localStorage.getItem('token');
      const { tenantId } = jwtDecode(token);

      // 1. Ingest Products
      await API.post(`/ingest/tenant/${tenantId}/products`, [
        { "id": 78901, "title": "Classic T-Shirt", "price": "25.00" },
        { "id": 78902, "title": "Denim Jeans", "price": "75.50" },
        { "id": 78903, "title": "Leather Belt", "price": "35.00" },
        { "id": 78904, "title": "Stylish Sunglasses", "price": "55.25" }
      ]);

      // 2. Ingest Customers
      await API.post(`/ingest/tenant/${tenantId}/customers`, [
        { "id": 89201, "first_name": "John", "last_name": "Doe", "email": "john.doe@example.com" },
        { "id": 89202, "first_name": "Jane", "last_name": "Smith", "email": "jane.smith@example.com" },
        { "id": 89203, "first_name": "Peter", "last_name": "Jones", "email": "peter.jones@example.com" },
        { "id": 89204, "first_name": "Mary", "last_name": "Williams", "email": "mary.w@example.com" }
      ]);

      // 3. Ingest Orders
      await API.post(`/ingest/tenant/${tenantId}/orders`, [
        { 
          "id": 55401, "total_price": "100.50", "created_at": "2025-09-10T10:00:00Z", 
          "customer": { "id": 89201 },
          "line_items": [
            { "product_id": 78901, "quantity": 1, "price": "25.00" },
            { "product_id": 78902, "quantity": 1, "price": "75.50" }
          ]
        },
        { 
          "id": 55402, "total_price": "50.00", "created_at": "2025-09-09T15:30:00Z", 
          "customer": { "id": 89202 },
          "line_items": [{ "product_id": 78901, "quantity": 2, "price": "25.00" }]
        },
        { 
          "id": 55403, "total_price": "90.25", "created_at": "2025-09-08T11:00:00Z", 
          "customer": { "id": 89203 },
          "line_items": [
            { "product_id": 78903, "quantity": 1, "price": "35.00" },
            { "product_id": 78904, "quantity": 1, "price": "55.25" }
          ]
        },
        { 
          "id": 55404, "total_price": "145.50", "created_at": "2025-09-07T18:45:00Z", 
          "customer": { "id": 89202 },
          "line_items": [{ "product_id": 78902, "quantity": 2, "price": "75.50" }]
        }
      ]);

      // 4. Ingest Sample Events
      await API.post(`/ingest/tenant/${tenantId}/events`, [
        { "eventName": "checkout_started", "customerId": 89201 },
        { "eventName": "checkout_started", "customerId": 89202 },
        { "eventName": "checkout_started", "customerId": 89203 },
        { "eventName": "checkout_started", "customerId": 89204 },
        { "eventName": "cart_abandoned", "customerId": 89204 },
        { "eventName": "cart_abandoned", "customerId": 89201 }
      ]);

      await fetchData();
    } catch (err) {
      setError('Failed to ingest data. Please check the server logs.');
    } finally {
      setIngesting(false);
    }
  };

  const handleFilterOrders = async () => { /* ... */ };

  if (loading) return <h2>Loading dashboard...</h2>;

  return (
    <div style={{ padding: '20px' }}>
      {/* ... (The rest of your JSX is exactly the same) ... */}
    </div>
  );
}
